import img1 from "./search1.png"; 

function Menu(){
    return (
             <div className="nav_elements">
      <ul>
        <li>Company</li>
        <li>Vehicles</li>
        <li>Design</li>
        <li>Innovation</li>
        <li>Museum & History</li>
        <li>Sports</li>
        <li>Events</li>
        <li>Lifestyle</li>
        <li><img src={img1} alt="" class="list_img" style="height: 20px; width: 20px ; position: absolute;" /></li>
      </ul>
        </div>
    )
}

export default Menu;
